import React from "react";

const {Modal} = require('react-materialize')

type MyProps = {
  message: string;
};
type MyState = {
  count: number;
};

class Home extends React.Component<MyProps, MyState> {
  state: MyState = {
    count: 2
  }

  render() {
    return (
      <div className="container">
        {/*<Modal>Hi</Modal>*/}
        <div className="row rounded">
          <h1>{this.props.message}: {this.state.count}</h1>
        </div>
      </div>
    );
  }
}

export default Home;
